import './App.css';
import Content from './Content';
import NavBar from './NavBar';
function App() {
  return (
    <>
    <BrowserRouter>
    <NavBar name="Vinayak Santhosh"/>
    <h1>This is Sparta!!!!</h1>
      <Routes>
         <Route path="/testimonials" element={<Testimonials/>}></Route>
      </Routes>
    </BrowserRouter>
    <Content name="Vinayak Sathosh"/>
    </>
  );
}

export default App;
